import React from 'react';
import Classes from './styles/Nav.module.css';
const Nav = () => {
    return (
        <nav className={Classes.nav}>
            <div className="sidebar">
                <div className={Classes.sidebar_info}>
                    <input type="button" className="sidebar_buttons" value="Profile" />
                    <input type="button" className="sidebar_buttons" value="Messages" />
                    <input type="button" className="sidebar_buttons" value="Friends" />
                    <input type="button" className="sidebar_buttons" value="News" />
                    <input type="button" className="sidebar_buttons" value="Music" />
                    <input type="button" className="sidebar_buttons" value="Settings" />
                </div>
            </div>
        </nav>
    )
}


export default Nav;
